import React, { Component } from "react";
export default class DocumentTemp extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  componentDidMount() {
    const { data } = this.props;
    let token = data[0].User.access_token;
    console.log(token);
  }
  render() {
    return <></>;
  }
}
